Object.Field:
	    import oracle.odi.mapping.generation.AbstractSyntaxTree.ASTProducerMethod;
		import oracle.odi.domain.mapping.generator.KMGeneratorDelegateRegistry.GeneratorDelegateClass;
	    @GeneratorDelegateClass(componentType="AP", descriptionKey="GeneratorDelegateClass.LKM_HDFS_FileToHiveDirect")
        public class LKM_HDFS_File_to_Hive_LOAD_DATA_Direct extends HiveHdfsLKM {

    	    //class constructor; initialization is done in setBinding method
            public LKM_HDFS_File_to_Hive_LOAD_DATA_Direct() {}      

            // Declare KM level vars
            protected boolean option_CREATE_TARG_TABLE
            protected boolean option_TRUNCATE
            protected HiveCreateTableStatement tgtTableAST
            protected FileToHiveStatement tgtAST
            protected OdiDataStore sourceDataStore, targetDataStore;
            protected Object serdevalue;
            protected Object inputfvalue;
            protected Object outFvalue;
            protected Object fileFormat;
            protected Object schemaFile;
            protected Object tblPropvalue;
            protected Object storageFormat;
            protected Object fieldSep;
            protected Object recSep;
            protected Object storageRowFormat;
            protected Object escpChar;
            protected Object mapKeytSep;
            protected Object collecSep;
            protected Object nullDefinedAs;
            protected Object externalTableLocation;

    	public void setBinding( Binding binding ) {
        	super.setBinding( binding )
            // Initialize variables
            option_CREATE_TARG_TABLE      = isOptionTrue( "CREATE_TARG_TABLE" )
            option_TRUNCATE               = isOptionTrue( "TRUNCATE" )
            List<MapPhysicalNode> downStreamNodes = this.physicalNode.getDownstreamConnectedNodes();
            while (!downStreamNodes.get(0).isTargetNode()){
            	downStreamNodes = downStreamNodes.get(0).getDownstreamConnectedNodes();
        }
            MapPhysicalNode childNode = downStreamNodes.get(0);
            Object tgtCompBondObj = childNode.getLogicalComponent().getBoundObject();
            targetDataStore = ((oracle.odi.domain.model.OdiDataStore) tgtCompBondObj).getRealObject()

          	List<MapPhysicalNode> upStreamNodes = this.physicalNode.getUpstreamConnectedNodes();
          	while (!upStreamNodes.get(0).isSourceNode()){
          		upStreamNodes = upStreamNodes.get(0).getUpstreamConnectedNodes();
          	}
          	MapPhysicalNode parentNode = upStreamNodes.get(0);
          	Object srcCompBondObj = parentNode.getLogicalComponent().getBoundObject();
          	sourceDataStore = ((oracle.odi.domain.model.OdiDataStore) srcCompBondObj).getRealObject()
            serdevalue = targetDataStore.getHadoopStorageDescriptor().getSerde(); 
            inputfvalue = targetDataStore.getHadoopStorageDescriptor().getInputFormat(); 
            outFvalue = targetDataStore.getHadoopStorageDescriptor().getOutputFormat();   
            schemaFile = sourceDataStore.getHadoopStorageDescriptor().getSchemaFile();
            if(schemaFile != null)   
            tblPropvalue = """<?=odiRef.getInfo("SRC_SCHEMA")?>""" + (schemaFile.substring(schemaFile.lastIndexOf('/')));
            storageFormat = sourceDataStore.getHadoopStorageDescriptor().getFormatType().getName();
            fileFormat = targetDataStore.getHadoopStorageDescriptor().getFormatType();
            if (!SnpsStringTools.replaceNVL(targetDataStore.getHadoopStorageDescriptor().getFieldSeparator()).trim().equals(""))
               fieldSep = SnpsStringTools.replaceNVL(SnpsStringTools.escapeUnicode(targetDataStore.getHadoopStorageDescriptor().getFieldSeparator(), false))
            if (!SnpsStringTools.replaceNVL(targetDataStore.getHadoopStorageDescriptor().getRowSeparator()).trim().equals(""))
             recSep = SnpsStringTools.replaceNVL(SnpsStringTools.escapeUnicode(SnpsStringTools.hexStrToStr(targetDataStore.getHadoopStorageDescriptor().getRowSeparator()), true))

            storageRowFormat = targetDataStore.getHadoopStorageDescriptor().getHiveRowFormat();
            escpChar = targetDataStore.getHadoopStorageDescriptor().getEscapeCharacter();
            mapKeytSep = targetDataStore.getHadoopStorageDescriptor().getMapKeysSeparator();
            collecSep = targetDataStore.getHadoopStorageDescriptor().getCollectionSeparator();
            nullDefinedAs = targetDataStore.getHadoopStorageDescriptor().getNullDefinedAs();

            externalTableLocation = targetDataStore.getHadoopStorageDescriptor().getHiveLocation();
            option_EXTERNAL_TABLE         = !targetDataStore.getHadoopStorageDescriptor().isHiveManaged()
            String targetFileFormatName = fileFormat.getName().toString();

            if (storageFormat != null && !(storageFormat.toString().equalsIgnoreCase(storageRowFormat.toString()))) {
            	if(targetFileFormatName != null && !(storageFormat.equalsIgnoreCase(targetFileFormatName))){
            		if ("INPUTFORMAT".equalsIgnoreCase(targetFileFormatName) ) {
            			if(inputfvalue == null && outFvalue == null){
            			throw new OdiKMException("ODLKM-HADOOP-LKM-10000", "ODLKM-HADOOP-LKM-10000: Input Format / Output Format are null for Pre Dedined File Format");
            			} else if(!(inputfvalue.toLowerCase().contains(storageFormat.toLowerCase())) && !(outFvalue.toLowerCase().contains(storageFormat.toLowerCase())))  {
            			throw new OdiKMException("ODLKM-HADOOP-LKM-10000", "ODLKM-HADOOP-LKM-10000: Source HDFS file Storage Format should match the Hive table datastore Row Format/ Predefiend.");
        }
            		} else {
            		throw new OdiKMException("ODLKM-HADOOP-LKM-10000", "ODLKM-HADOOP-LKM-10000: Source HDFS file Storage Format should match the Hive table datastore Row Format/ Predefiend.");
            		}
            	}
            }        		
        }

        void updateBinding() {
        	super.updateBinding()
            // Publish variables into binding to make them available in templates and variableDefText
            mBinding.setVariable( "option_CREATE_TARG_TABLE",      option_CREATE_TARG_TABLE ) 
            mBinding.setVariable( "option_TRUNCATE",               option_TRUNCATE )                         
            mBinding.setVariable( "tgtTableAST",  tgtTableAST )
            mBinding.setVariable( "tgtAST",       tgtAST )
        }    	
          AbstractSyntaxTree getHiveLoadDataCommand( HiveTable table, SqlQuery input ) {
            def compKM  = generatorContext.getComponentKM(); //compKM.getName()            
            def ast

            // Is this a transparent target load?
            if ( physicalNode.isDirectLoad() ) {

            	//TODO: for transparent LKMs: we have to validate tighter constraints: e.g. all target columns must be mapped from source expression except for partition columns. 
            	//These can also be filled with constant value or file name fragments

                def tgtCols    = new ArrayList<Column>();
                def selectList = new ArrayList<ISelectItem>();    	
                def query = getSourceAndTargetExpressionsAndQuery( table, input, selectList, tgtCols, 
                    { attr -> 
                    	// for direct LKMs all MapPhysicalColumns should be mapped. 
                    	// So we error out, if any unmapped column:
                    	// As long as we do rowformat handling without a dedicated component for proper input/output signature handling,
                    	// we have to tolerate unmapped target columns!
                    	//if ( attr.getExpression() == null ) 
                    	    //TODO: use correct expression
                    	    //throw new RuntimeException( """Column "${attr.getName()}" is not mapped. For direct loading all columns must be mapped.""" )
                    	// Otherwise just copy the expression over
                    	return new CopyColumnExpression()
                    }  )                  
                ast     = new FileToHiveStatement( physicalNode, table, tgtCols, query, ffFinder, false, false )

          } else {
          	// No, this is a standard LKM node. So we use the node's physical columns
          	def tgtCols    = new ArrayList<Column>();
              def selectList = new ArrayList<ISelectItem>();    	
              def query = getSourceAndTargetExpressionsAndQuery( table, input, selectList, tgtCols, 
                  { attr -> // for LKMs all MapPhysicalColumns are mapped. So we can just copy all columns:
                  	return new CopyColumnExpression()
                  }  )                
              ast     = new FileToHiveStatement( physicalNode, table, tgtCols, query, ffFinder, false, true )              
          }

          def sourceDataStore = ast.getSourceFileDataStore()
          def rowFormatClause = ""          
          if ( getOption("OVERRIDE_ROW_FORMAT").trim().length() > 0 ) { 
              rowFormatClause   = getOption("OVERRIDE_ROW_FORMAT")
          } else {
             def serde = ""
             def inputformat = ""
             def outputformat = ""
             def fileFormatName = ""
             def tblprop = ""
             def storFormat = ""

             if ( serdevalue != null) {
               serde = serdevalue.toString();
             }
             if ( inputfvalue != null) {
               inputformat = inputfvalue.toString();
             }
             if (fileFormat != null) {
               fileFormatName = fileFormat.getName().toString();
             }
             if (outFvalue != null) {
               outputformat = outFvalue.toString();
             }
             if ( tblPropvalue != null) {
               tblprop = tblPropvalue.toString();
             }
             if ( storageFormat != null) {
               storFormat = storageFormat.toString();
             }
             if (storageRowFormat != null && storageRowFormat == oracle.odi.domain.model.OdiDataStore.HadoopStorageDescriptor.HiveRowFormat.DELIMITED) {
               rowFormatClause  += """ROW FORMAT DELIMITED\n"""
               rowFormatClause  +=  """FIELDS TERMINATED BY '""" + fieldSep.toString() + """' \n""" 
               if ( escpChar != null) {rowFormatClause  += """ESCAPED BY '""" + escpChar.toString() + """' \n"""}
               if (collecSep != null) {rowFormatClause  += """COLLECTION ITEMS TERMINATED BY '""" + collecSep.toString() + """' \n"""}
               if (  mapKeytSep != null) {rowFormatClause  +=  """MAP KEYS TERMINATED BY '""" + mapKeytSep.toString() + """' \n"""}
               if ( recSep != null) {rowFormatClause  +=  """LINES TERMINATED BY '""" +  recSep.toString() + """' \n"""} 
               if ( nullDefinedAs != null) {rowFormatClause  += """NULL DEFINED AS '""" + nullDefinedAs.toString() + """' \n"""} 
               rowFormatClause  += """STORED AS """ 
             } else if (storageRowFormat != null && storageRowFormat == oracle.odi.domain.model.OdiDataStore.HadoopStorageDescriptor.HiveRowFormat.SERDE) {  
               rowFormatClause  = """ROW FORMAT SERDE '""" + serde + """' \n""" + """STORED AS """ 
             } else if (storageRowFormat != null && storageRowFormat == oracle.odi.domain.model.OdiDataStore.HadoopStorageDescriptor.HiveRowFormat.BUILT_IN) {  
               if("JSON".equalsIgnoreCase(fileFormatName)){
                 rowFormatClause  = """ROW FORMAT SERDE '""" + "org.apache.hive.hcatalog.data.JsonSerDe"  + """' \n""" + """STORED AS """
               }else {
                 rowFormatClause  = """STORED AS """
               }              
             }
             if (inputformat.trim().length() > 0 && outputformat.trim().length() > 0 && "INPUTFORMAT".equalsIgnoreCase(fileFormatName)) {
               rowFormatClause += """\nINPUTFORMAT '""" + inputformat + """' \n""" +
                               """OUTPUTFORMAT '""" + outputformat + """' \n"""
               if ( option_EXTERNAL_TABLE )
               rowFormatClause += """\nLOCATION '""" + externalTableLocation + """' \n"""
               if (tblprop.trim().length() > 0 && "AVRO".equalsIgnoreCase(storFormat))
                 rowFormatClause += """TBLPROPERTIES ( """ + """'avro.schema.url'='""" + tblprop.trim() + """') \n"""                   
             } else if (fileFormatName.trim().length() > 0 && !"JSON".equalsIgnoreCase(fileFormatName)) {
               rowFormatClause += fileFormatName  + """ \n"""
               if ( option_EXTERNAL_TABLE )
               rowFormatClause += """\nLOCATION '""" + externalTableLocation + """' \n"""
               if (tblprop.trim().length() > 0 && "AVRO".equalsIgnoreCase(fileFormatName))
                 rowFormatClause += """TBLPROPERTIES ( """ + """'avro.schema.url'='""" + tblprop.trim() + """') \n""" 
             } else {
               if (storageRowFormat != null)
                 rowFormatClause += """TEXTFILE\n"""
               if ( option_EXTERNAL_TABLE )
               rowFormatClause += """\nLOCATION '""" + externalTableLocation + """' \n"""
              }
            }            
            table.external = option_EXTERNAL_TABLE 
            table.rowFormatClause = rowFormatClause

            ast.setTargetTechnology( getGroovyTechnology() )
            return ast
        }		
		@ASTProducerMethod(processingType=ProcessingType.TARGET, producedASTType=HiveInsertStatement.class, styleKey="ProcessingStyleKey.Hive.INSERT")
        AbstractSyntaxTree INSERT(SqlQuery input) {
            // No staging table
            stgAST = null
            stgTableAST = null

            def targetTable = getTargetTable()
            tgtAST = getHiveLoadDataCommand( targetTable, input )
    		tgtAST.setOverwrite(option_TRUNCATE)
            tgtTableAST = new HiveCreateTableStatement( "abc", "def", targetTable, getHiveTechnology(), ffFinder )
            def targetColumnList = physicalNode.getParentNode().getNodeAttributes().collect { attr -> Column.getColumn( targetTable, attr ) }            
            tgtTableAST.setColumns( targetColumnList )

            // When this is an external table, we do not need to explicitly load the data files
            if ( option_EXTERNAL_TABLE )
                tgtAST.skipGenerateTask()

            // Publish variables into binding to make them available in templates and variableDefText
            updateBinding()   
            return tgtAST
        }
        } // end of LKM class
